def _cython_agg_blocks(
        self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
    ) -> "Tuple[List[Block], Index]":
        data = self._get_data_to_aggregate()

        data_to_agg = data._convert(should_cast=True, copy=True)

        if numeric_only:
            data_to_agg = data_to_agg._get_numeric_data()

        agg_blocks = []
        agg_labels = []
        split_frames = []

        for label, block in data_to_agg.items():
            try:
                result, _ = self.grouper.aggregate(
                    block.values, how, min_count=min_count
                )
            except TypeError:
                result = self.grouper.aggregate(
                    block.values, how, axis=1, min_count=min_count
                )

            agg_labels.append(label)
            agg_blocks.append(result)

        results = [make_block(res, loc=l, klass=type(self.obj)) for res, l in zip(agg_blocks, agg_labels)]

        return results, data.items
